import React from "react";
import { StyleSheet } from "react-native";
import { View, Text } from "../Themed";

const InputBox = () => {
    return (
        <View >
            <View>
                hello
            </View>
            <View>
                hello
            </View>
        </View>
    );
}

export default InputBox;

const styles = StyleSheet.create({
    component: {
        flexDirection: 'row',
    },
    mainContainer: {

    }
});
